    label: 'Ballet',
    selected: false,
  },
};

// React application
function App() {
  const [options, setOptions] = useState(OPTIONS);
  return (
    <div className="App">
      <HandleNavigation />
      <div style={{ marginLeft: '64px' }}>
        <FilterDropdown buttonText="Style" options={options} setOptions={setOptions} />
      </div>
    </div>
  );
}

// Render React application
ReactDOM.render(
  <React.StrictMode>
    <App />
  </React.StrictMode>,
  document.getElementById('root')
);
